import { getPostById } from "../../services/singleService";
import { getUserById } from "../../services/userService";

export const useGetUserByParentId = (parentId) => {
    const { post } = getPostById(parentId || '');
    const { user } = getUserById(post?.user_id || '');
    
    return user;
}
